import { MDBContainer } from 'mdbreact'
import React, { Component } from 'react'

export default class Quote extends Component {
    render() {
        return (
            <section className="pt-5" style={{ backgroundImage: `url('img/bg.jpg')` }}>
                <MDBContainer className="py-5">
                    <h1 class="display-4 text-center">We Buy Your Old Gears</h1>
                    <p class="text-center">The process is fast, the service is free. It's time to make money off that old gears, simple and easy.</p>
                    <hr class="my-5"/>
                    <ul class="stepper" data-mdb-stepper="stepper" data-mdb-stepper-type="vertical"></ul>
                </MDBContainer>
            </section>
        )
    }
}
